selector_to_html = {"a[href=\"https://en.wikipedia.org/wiki/Modal_testing\"]": "<p><b>Modal testing</b> is the form of vibration testing of an object whereby the natural (modal) frequencies, modal masses, modal damping ratios and mode shapes of the object under test are determined.</p>", "a[href^=\"https://en.wikipedia.org/wiki/Modal_testing#\"]": "<p><b>Modal testing</b> is the form of vibration testing of an object whereby the natural (modal) frequencies, modal masses, modal damping ratios and mode shapes of the object under test are determined.</p>", "a[href=\"#question-1\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 1<a class=\"headerlink\" href=\"#question-1\" title=\"Link to this heading\">#</a></h3><p>Let\u2019s start by noting that according to <a class=\"reference internal\" href=\"#equation-eq-lec4-ex0-sol-modulus\">(8)</a> and <a class=\"reference internal\" href=\"#equation-eq-lec4-ex0-sol-phase\">(9)</a>, the Bode plots of <span class=\"math notranslate nohighlight\">\\(G_o(s)\\)</span> (and hence the closed-loop performance) can be inferred from the Bode plots of <span class=\"math notranslate nohighlight\">\\(G(s)\\)</span> without actually knowing its analytical expression!</p>", "a[href=\"#solution\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Solution<a class=\"headerlink\" href=\"#solution\" title=\"Link to this heading\">#</a></h2><h3>Question 1<a class=\"headerlink\" href=\"#question-1\" title=\"Link to this heading\">#</a></h3><p>Let\u2019s start by noting that according to <a class=\"reference internal\" href=\"#equation-eq-lec4-ex0-sol-modulus\">(8)</a> and <a class=\"reference internal\" href=\"#equation-eq-lec4-ex0-sol-phase\">(9)</a>, the Bode plots of <span class=\"math notranslate nohighlight\">\\(G_o(s)\\)</span> (and hence the closed-loop performance) can be inferred from the Bode plots of <span class=\"math notranslate nohighlight\">\\(G(s)\\)</span> without actually knowing its analytical expression!</p>", "a[href=\"#fig-lec4-ex0-sol-bode\"]": "<figure class=\"align-default\" id=\"fig-lec4-ex0-sol-bode\">\n<a class=\"reference internal image-reference\" href=\"../_images/ex0-bode.svg\"><img alt=\"../_images/ex0-bode.svg\" src=\"../_images/ex0-bode.svg\" style=\"width: 750px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 20 </span><span class=\"caption-text\">Bode plot of the mechanical system <span class=\"math notranslate nohighlight\">\\(G(s)\\)</span></span><a class=\"headerlink\" href=\"#fig-lec4-ex0-sol-bode\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>", "a[href=\"#equation-eq-lec4-ex0-sol-phase\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-lec4-ex0-sol-phase\">\n\\[\n\\angle G_o(i \\omega) = \\angle F(i \\omega) + \\angle G(i \\omega)\n\\]</div>", "a[href=\"#equation-eq-lec4-ex0-sol-modulus\"]": "<div class=\"math notranslate nohighlight\" id=\"equation-eq-lec4-ex0-sol-modulus\">\n\\[\n\\lvert G_o(i \\omega) \\lvert_{\\text{dB}} = \\lvert F(i \\omega) \\lvert_{\\text{dB}}  + \\lvert G(i \\omega) \\lvert_{\\text{dB}} \n\\]</div>", "a[href=\"#question-2\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Question 2<a class=\"headerlink\" href=\"#question-2\" title=\"Link to this heading\">#</a></h3><p>As seen during the lecture F6, the closed-loop resonance peak satisfies</p>", "a[href=\"#solutions-of-exercise-4-0\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Solutions of Exercise 4.0<a class=\"headerlink\" href=\"#solutions-of-exercise-4-0\" title=\"Link to this heading\">#</a></h1><p>We are given a mechanical system represented by the transfer function <span class=\"math notranslate nohighlight\">\\(G(s)\\)</span>. While an explicit expression for <span class=\"math notranslate nohighlight\">\\(G(s)\\)</span> is not available, we have obtained its frequency response through a lot of <a class=\"reference external\" href=\"https://en.wikipedia.org/wiki/Modal_testing\">hammer tests</a>. The resulting frequency response is depicted in <a class=\"reference internal\" href=\"#fig-lec4-ex0-sol-bode\"><span class=\"std std-numref\">Fig. 20</span></a> below.</p>", "a[href=\"#fig-lec4-ex0-bode-sol\"]": "<figure class=\"align-default\" id=\"fig-lec4-ex0-bode-sol\">\n<a class=\"reference internal image-reference\" href=\"../_images/ex0-bode-sol-mag.svg\"><img alt=\"../_images/ex0-bode-sol-mag.svg\" src=\"../_images/ex0-bode-sol-mag.svg\" style=\"width: 1000px;\"/>\n</a>\n<figcaption>\n<p><span class=\"caption-number\">Fig. 21 </span><span class=\"caption-text\">Bode plot of <span class=\"math notranslate nohighlight\">\\(G_o(s)\\)</span> for <span class=\"math notranslate nohighlight\">\\(K_{\\text{dB}} = 22\\)</span> dB (blue line) and for <span class=\"math notranslate nohighlight\">\\(K_{\\text{dB}} = 36\\)</span> dB (red line).</span><a class=\"headerlink\" href=\"#fig-lec4-ex0-bode-sol\" title=\"Link to this image\">#</a></p>\n</figcaption>\n</figure>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: false,
                placement: 'auto-start', maxWidth: 500, interactive: true, boundary: document.body, appendTo: document.body,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {var isFirefox=typeof InstallTrigger!=='undefined';if(isFirefox&&window.MathJax&&MathJax.startup&&MathJax.startup.output&&MathJax.startup.output.name==="SVG"){const svgs=instance.popper.querySelectorAll('svg');svgs.forEach(svg=>{let bbox=svg.getBBox(),x=bbox.x,y=bbox.y,width=bbox.width,height=bbox.height;svg.setAttribute('width',width);svg.setAttribute('height',height);svg.setAttribute('viewBox',`${x} ${y} ${width} ${height}`);});let rescale=0.015;svgs.forEach(svg=>{let bbox=svg.getBBox(),width=bbox.width,height=bbox.height;svg.setAttribute('width',width*rescale);svg.setAttribute('height',height*rescale);});}});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
